      deployedUrl: 'https://deployed-url-1',
      repoUrl: 'https://github.com/user/repo1'
    },
    // Add other projects
  ];

  return (
    <section>
      <h2>Portfolio</h2>
      {projects.map((project, index) => (
        <Project key={index} project={project} />
      ))}
    </section>
  );
};

export default Portfolio;
